import React, { Component } from "react";
import { Link } from "react-router-dom";

import { fetchUserRentals } from "../../actions/";
import { connect } from "react-redux";

class RentalManage extends Component {
  constructor(props) {
    super(props);

    this.state = {
      userRentals: [],
      errors: [],
      isFetching: false
    };
  }

  componentDidMount() {
    this.props.fetchUserRentals();
  }

  render() {
    const { isAuthenticated } = this.props.auth;
    const { userRentals } = this.state;
    const { rentals } = this.props;

    return (
      <div>
        {isAuthenticated && (
          <div>
            {rentals.map((rental, i) => (
              <p key={i}>{rental.title}</p>
            ))}
          </div>
        )}
        <section id="userBookings">
          <h1 className="page-title">My Bookings</h1>
          <div className="row">
            <div className="col-md-4">
              <div className="card text-center">
                <div className="card-header">Rental Category</div>
                <div className="card-block">
                  <h4 className="card-title"> Rental Title - Rental City</h4>
                  <p className="card-text booking-desc">Rental Description</p>
                  <p className="card-text booking-days">
                    2018/04/04 - 2018/04/06 | 2 days
                  </p>
                  <p className="card-text booking-price">
                    <span>Price: </span>{" "}
                    <span className="booking-price-value">205 $</span>
                  </p>
                  <Link className="btn" to="rental detail">
                    Go to Rental
                  </Link>
                </div>
                <div className="card-footer text-muted">Created 2018/03/03</div>
              </div>
            </div>
          </div>
          <div class="alert alert-warning">
            You have no bookings created go to rentals section and book your
            place today.
            <Link
              style={{ "margin-left": "10px" }}
              class="btn btn-bwm"
              to="rentals index page"
            >
              Available Rental
            </Link>
          </div>
        </section>
      </div>
    );
  }
}

const mapStateToProps = state => ({
  auth: state.auth,
  rentals: state.rentals.rentals
});

export default connect(mapStateToProps, { fetchUserRentals })(RentalManage);
